import React from 'react';
import ReactDOM from 'react-dom';
import './index.css'

const d= new Date().toLocaleDateString();
const t= new Date().toLocaleTimeString();
const img1="https://www.google.com/search?q=birds+in+sky+images&sxsrf=ALeKk03EvVzKk-EDyG6uFxPsexclFqIPEw:1621602583676&tbm=isch&source=iu&ictx=1&fir=YjjOPye2IYSrNM%252CjgReiNwWoTyspM%252C_&vet=1&usg=AI4_-kSSnqxh5GONXXwmvRpyqNgi1cSoGg&sa=X&ved=2ahUKEwjExNev7NrwAhUdxjgGHQAkDlIQ9QF6BAgTEAE&biw=666&bih=561&dpr=1.5#imgrc=YjjOPye2IYSrNM";
ReactDOM.render(
    <div>
    <h1 className="heading" >Hello, my name is prashant kumar</h1>
      <p>current date={d}</p>
      <img src={img1} alt="image of birds" />
      <p>current time= {t} </p>
    </div>,
    document.getElementById('root')
);
